const socialMedia = [
    {
        name: 'Facebook',
        link: 'https://www.fb.com'
    }
    , {
        name: 'Instagram',
        link: 'https://www.instagram.com'
    }
    , {
        name: 'Booksy',
        link: 'https://www.booksy.com'
    }
]

const socialMediaButtons = () => {

    //open a new tab with its respective link
    const handleClick = (link) => {
        window.open(
            link, '__blank'
        )
    }
    //generate social media buttons
    const generateButtons = () => {
        return (
            socialMedia.map((item) => {
                return (
                    <button className='socialMediaButtons' id key={item.link} onClick={() => { handleClick(item.link) }} >{item.name}</button>
                )
            })
        )
    }



    return (
        <div className ='socialMediaButtonsContainer'>
            {generateButtons()}

        </div>
    )
}

export default socialMediaButtons;
